/**
 * @param {ListNode} head
 * @return {boolean}
 */
var hasCycle = function(head) {
 if( !head || !head.next){
     return false
 }
 let slow = head;
 let fast = head;
 while( fast && fast.next ){
     fast = fast.next.next
     slow = slow.next
     if(fast === slow){
         return true
     }
 }
 return false
};
